import React, {Component} from 'react';
import Form from './Form';
import Nav from './Nav';
import apiKey from './config';
import PhotoContainer from './PhotoContainer';


class App extends Component {

  state = {
    images: []
  };

  componentDidMount() {
    fetch(`https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=${apiKey}&tags=dogs&per_page=24&format=json&nojsoncallback=1`)
    .then(response=> response.json())
    .then(responseData => {
      this.setState({images: responseData.photos});
    })
    .catch(error => {
      console.log('Error fetching and parsing data', error);
    });
  }

  render(){

    return (
      <div>
        <Form />
        <Nav />
        <PhotoContainer images={this.props.images}/>
      </div>
    );
  }
}



export default App;
